const Card = () => {
  return (
    <>
      <div class="container">
        <main class="wrapper">
          <img class="banner-image" src="" />
          <h1>Nombre del juego </h1>
          <p>
            Lorem ipsum dolor sit amet, <br />
            consectetur adipiscing elit.
          </p>
        </main>
        <footer class="button-wrapper">
          <button class="btn outline">DETAILS</button>
          <button class="btn fill">DELETE</button>
        </footer>
      </div>
    </>
  );
};

module.export = Card;
